import React, { useState } from 'react';
import DashboardLayout from '../layouts/DashboardLayout';
import FileUploader from '../components/batch/FileUploader';
import BatchResults from '../components/batch/BatchResults';

const BatchPredict = () => {
  const [results, setResults] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleFileUpload = async (file) => {
    setIsLoading(true);
    try {
      // Process the uploaded file
      // This is where you'd call your API
      console.log('Processing file:', file.name);
      
      // For now, simulate processing
      setTimeout(() => {
        setResults([
          { id: 1, name: 'John Doe', age: 45, risk: 'High', score: 0.85 },
          { id: 2, name: 'Jane Smith', age: 38, risk: 'Medium', score: 0.62 }
        ]);
        setIsLoading(false);
      }, 2000);
      
    } catch (error) {
      console.error('Error processing file:', error);
      setIsLoading(false);
    }
  };

  const handleClearResults = () => {
    setResults(null);
  };

  return (
    <DashboardLayout>
      <div className="space-y-6">
        {/* Header */}
        <div className="bg-white rounded-lg shadow-sm p-6">
          <h1 className="text-2xl font-bold text-gray-900 mb-2">
            Batch Prediction
          </h1>
          <p className="text-gray-600">
            Upload a CSV file to predict cardiovascular risk for multiple patients at once
          </p>
        </div>

        {/* File Uploader */}
        <div className="bg-white rounded-lg shadow-sm p-6">
          <FileUploader 
            onFileUpload={handleFileUpload}
            isLoading={isLoading}
          />
        </div>

        {/* Results */}
        {results ? (
          <div className="bg-white rounded-lg shadow-sm p-6">
            <BatchResults 
              results={results}
              onClear={handleClearResults}
            />
          </div>
        ) : (
          <div className="bg-white rounded-lg shadow-sm p-6">
            <div className="text-center py-12">
              <div className="text-gray-400 mb-4">
                <svg className="mx-auto h-12 w-12" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
                </svg>
              </div>
              <h3 className="text-lg font-medium text-gray-900 mb-2">No results yet</h3>
              <p className="text-gray-500">
                Upload a CSV file to see batch prediction results
              </p>
            </div>
          </div>
        )}
      </div>
    </DashboardLayout>
  );
};

export default BatchPredict;
